import React from "react";
import { FaShoppingCart } from "react-icons/fa";

export default function Header() {
  return (
    <header>
      <div>
        <span className="logo">House Staff</span>

        <ul className="nav">
          <li>About</li>
          <li>Contact</li>
          <li>File</li>
        </ul>

        <FaShoppingCart className="" />
      </div>

      <div className="presentation"></div>
    </header>
  );
}
